var $bm_rt;
var layer1, layer2, controller, zeroName, zero, ctrlEffect, limit, FK, IKFK, cw;
layer1 = thisComp.layer('LAMP LOWER Outlines');
layer2 = thisComp.layer('LAMP UPPER Outlines');
controller = thisComp.layer('C_LAMP HEAD Outlines');
zeroName = 'IK_zero LAMP UPPER Outlines';
zero = thisComp.layer(zeroName);
ctrlEffect = controller.effect('IK LAMP UPPER Outlines');
limit = effect('IK Limit')(1);
FK = ctrlEffect(4);
IKFK = ctrlEffect(3) == 0;
cw = ctrlEffect(1) == 1;
function getWorldPos(L) {
    return L.toWorld(L.anchorPoint);
}
function ik() {
    var A, B, C, E, a, b, c, x, alpha, D, delta, result, V, adj1, IK;
    A = getWorldPos(layer1);
    B = getWorldPos(layer2);
    C = getWorldPos(zero);
    E = getWorldPos(controller);
    a = length(B, C);
    b = length(E, A);
    c = length(A, B);
    x = div(sub(sum(mul(b, b), mul(c, c)), mul(a, a)), mul(2, b));
    alpha = Math.acos(clamp(div(x, c), -1, 1));
    D = sub(E, A);
    delta = Math.atan2(D[1], D[0]);
    result = radiansToDegrees(sub(delta, mul(cw ? 1 : -1, alpha)));
    V = sub(B, A);
    adj1 = radiansToDegrees(Math.atan2(V[1], V[0]));
    IK = sum(sub(result, adj1), value);
    if (IK < limit)
        IK += 360;
    return IK;
}
$bm_rt = IKFK ? ik() : FK;

